import React, { useContext } from "react";
import { Link, Outlet, useNavigate  } from "react-router-dom";
//style
import { Container, Logga, Nav, SignOut, Content } from './Form.styles.js';
//components
import Burger from "../BurgerMenu/index.js";
import AppContext from "../../AppContext";

const Header = () => {

    const myContext = useContext(AppContext);
    const auth = myContext.auth;
    let navigate = useNavigate();
    let admin = true; /* byt ut denna sen, checka om det 채r admin vid inlogg */
    let user = false; /* byt ut denna sen, checka om det 채r admin vid inlogg */

    const handleSubmit = async (event)  => {
        myContext.toggleAuth(false);
        localStorage.clear();
        navigate("/");
        event.preventDefault();
    }

    return (
        <Container>
                        <Burger/>

            <Logga> Svenska Elsparkcyklar </Logga>

            {auth && (
            <>
                <Nav>
                    <Link to="/home" > Hem </Link> 
                    {admin &&
                    <>
                    <Link to="/admin" > Admin </Link> 
                    <Link to="/account" > Hantera kunder </Link>
                    </>
                    }
                    {user &&
                    <>
                    <Link to="/account" > Konto </Link>
                    <Link to="/history" > Historik </Link>
                    </>
                    }
                </Nav>
                <Outlet/> {/* outlet renderar child  */}
            <SignOut>
                <form onSubmit={handleSubmit} className = "logout">
                    <input type="submit" value="Logga ut" />
                </form>
            </SignOut>
            </>
            )}
        </Container>
    )
}

export default Header
